/*Table structure for table `check_application` */

DROP TABLE IF EXISTS `check_application`;

CREATE TABLE `check_application` (
  `id` int(25) NOT NULL AUTO_INCREMENT COMMENT '检查主键',
  `registration_info_no` int(25) DEFAULT NULL COMMENT '挂号主键',
  `medical_record` char(13) DEFAULT NULL COMMENT '病历号',
  `patient_name` varchar(40) DEFAULT NULL COMMENT '患者名字',
  `department_name` varchar(40) DEFAULT NULL COMMENT '部门名字',
  `outpatient_doctor_no` int(25) DEFAULT NULL COMMENT '门诊医生id',
  `outpatient_doctor_name` varchar(40) DEFAULT NULL COMMENT '门诊医生姓名',
  `clinical_impression` varchar(200) DEFAULT NULL COMMENT '临床印象',
  `clinical_diagnosis` varchar(200) DEFAULT NULL COMMENT '临床诊断',
  `requirements` varchar(300) DEFAULT NULL COMMENT '目的和要求',
  `fmed_item_nos` varchar(40) DEFAULT NULL COMMENT '检查项目主键: 3|4|7 之类的用|分割',
  `fmed_item_names` varchar(400) DEFAULT NULL COMMENT '检查项目名称: xxxx|yyyy|qqqq 之类的用|分割',
  `is_fee` char(1) DEFAULT '2' COMMENT '是否付费 费1，无费2',
  `is_registraion` char(1) DEFAULT '2' COMMENT '是否登记 登记1，无登记2（只有付费之后才能进行登记)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `state` char(1) DEFAULT '1' COMMENT '有效1，无效2',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

